import {Routes, Route, useNavigate, renderMatches} from 'react-router-dom';
import gcmateLogo from './img/GCMateIcon.png';
import MouseIcon from './img/CompMouse.png';
import './App.css';
import { LearnMore } from './components/LearnMore.js';

function App() {
  return (
    <div className="App" style={{
      position: 'absolute',
      backgroundImage: 'url('+gcmateLogo+')',
      backgroundSize: "cover",
      height: "721px",
      width: "1535px" 
    }}>
      
      <div className="Title"><h1> Welcome to GCMate! </h1></div> 

      <div className="Subtext"> <h2>Eager study buddies await...</h2></div>
      {/*<LearnMore />*/}
      <div className="LearnIcon" ><img src={MouseIcon} width="30" alt="aa"/></div>
    </div>
  );
}

export default App;
